def __init__(self, data: BlockManager, axes: Optional[List[Index]]=None, copy: bool=False, dtype: Optional[Dtype]=None, attrs: Optional[Mapping[Optional[Hashable], Any]]=None, fastpath: bool=False):
    if not fastpath:
        if dtype is not None:
            data = data.astype(dtype)
        elif copy:
            data = data.copy()
        if axes is not None:
            for (i, ax) in enumerate(axes):
                data = data.reindex_axis(ax, axis=i)
    object.__setattr__(self, '_is_copy', None)
    object.__setattr__(self, '_data', data)
    object.__setattr__(self, '_item_cache', {})
    if attrs is None:
        attrs = {}
    else:
        attrs = dict(attrs)
    object.__setattr__(self, '_attrs', attrs)

def _init_mgr(self, mgr, axes=None, dtype=None, copy=False):
    """ passed a manager and a axes dict """
    for (a, axe) in axes.items():
        if axe is not None:
            mgr = mgr.reindex_axis(axe, axis=self._get_block_manager_axis(a), copy=False)
    if copy:
        mgr = mgr.copy()
    if dtype is not None:
        if len(mgr.blocks) > 1 or mgr.blocks[0].values.dtype != dtype:
            mgr = mgr.astype(dtype=dtype)
    return mgr

