def _construct_axes_dict(self, axes=None, **kwargs):
    """Return an axes dictionary for myself."""
    d = {a: self._get_axis(a) for a in axes or self._AXIS_ORDERS}
    d.update(kwargs)
    return d

@staticmethod
def _construct_axes_dict_from(self, axes, **kwargs):
    """Return an axes dictionary for the passed axes."""
    d = {a: ax for (a, ax) in zip(self._AXIS_ORDERS, axes)}
    d.update(kwargs)
    return d

def _construct_axes_from_arguments(self, args, kwargs, require_all=False, sentinel=None):
    """Construct and returns axes if supplied in args/kwargs.

    If require_all, raise if all axis arguments are not supplied
    return a tuple of (axes, kwargs).

    sentinel specifies the default parameter when an axis is not
    supplied; useful to distinguish when a user explicitly passes None
    in scenarios where None has special meaning.
    """
    args = list(args)
    for a in self._AXIS_ORDERS:
        alias = self._AXIS_IALIASES.get(a)
        if alias is not None:
            if a in kwargs:
                if alias in kwargs:
                    raise TypeError('arguments are mutually exclusive for [%s,%s]' % (a, alias))
                continue
            if alias in kwargs:
                kwargs[a] = kwargs.pop(alias)
                continue
        if a not in kwargs:
            try:
                kwargs[a] = args.pop(0)
            except IndexError:
                if require_all:
                    raise TypeError('not enough/duplicate arguments specified!')
    axes = {a: kwargs.pop(a, sentinel) for a in self._AXIS_ORDERS}
    return (axes, kwargs)

@classmethod
def _from_axes(cls, data, axes, **kwargs):
    if isinstance(data, BlockManager):
        return cls(data, **kwargs)
    else:
        if cls._AXIS_REVERSED:
            axes = axes[::-1]
        d = cls._construct_axes_dict_from(cls, axes, copy=False)
        d.update(kwargs)
        return cls(data, **d)

@classmethod
def _get_axis_number(cls, axis):
    axis = cls._AXIS_ALIASES.get(axis, axis)
    if is_integer(axis):
        if axis in cls._AXIS_NAMES:
            return axis
    else:
        try:
            return cls._AXIS_NUMBERS[axis]
        except KeyError:
            pass
    raise ValueError('No axis named {0} for object type {1}'.format(axis, cls))

@classmethod
def _get_axis_name(cls, axis):
    axis = cls._AXIS_ALIASES.get(axis, axis)
    if isinstance(axis, str):
        if axis in cls._AXIS_NUMBERS:
            return axis
    else:
        try:
            return cls._AXIS_NAMES[axis]
        except KeyError:
            pass
    raise ValueError('No axis named {0} for object type {1}'.format(axis, cls))

def _get_axis(self, axis):
    name = self._get_axis_name(axis)
    return getattr(self, name)

@classmethod
def _get_block_manager_axis(cls, axis):
    """Map the axis to the block_manager axis."""
    axis = cls._get_axis_number(axis)
    if cls._AXIS_REVERSED:
        m = cls._AXIS_LEN - 1
        return m - axis
    return axis

def _get_axis_resolvers(self, axis):
    axis_index = getattr(self, axis)
    d = dict()
    prefix = axis[0]
    for (i, name) in enumerate(axis_index.names):
        if name is not None:
            key = level = name
        else:
            key = '{prefix}level_{i}'.format(prefix=prefix, i=i)
            level = i
        level_values = axis_index.get_level_values(level)
        s = level_values.to_series()
        s.index = axis_index
        d[key] = s
    if isinstance(axis_index, MultiIndex):
        dindex = axis_index
    else:
        dindex = axis_index.to_series()
    d[axis] = dindex
    return d

def _get_index_resolvers(self):
    d = {}
    for axis_name in self._AXIS_ORDERS:
        d.update(self._get_axis_resolvers(axis_name))
    return d

