def swapaxes(self, axis1, axis2, copy=True):
    """
    Interchange axes and swap values axes appropriately.

    Returns
    -------
    y : same as input
    """
    i = self._get_axis_number(axis1)
    j = self._get_axis_number(axis2)
    if i == j:
        if copy:
            return self.copy()
        return self
    mapping = {i: j, j: i}
    new_axes = (self._get_axis(mapping.get(k, k)) for k in range(self._AXIS_LEN))
    new_values = self.values.swapaxes(i, j)
    if copy:
        new_values = new_values.copy()
    return self._constructor(new_values, *new_axes).__finalize__(self)

def __neg__(self):
    values = com.values_from_object(self)
    if is_bool_dtype(values):
        arr = operator.inv(values)
    elif is_numeric_dtype(values) or is_timedelta64_dtype(values) or is_object_dtype(values):
        arr = operator.neg(values)
    else:
        raise TypeError('Unary negative expects numeric dtype, not {}'.format(values.dtype))
    return self.__array_wrap__(arr)

def __pos__(self):
    values = com.values_from_object(self)
    if is_bool_dtype(values) or is_period_arraylike(values):
        arr = values
    elif is_numeric_dtype(values) or is_timedelta64_dtype(values) or is_object_dtype(values):
        arr = operator.pos(values)
    else:
        raise TypeError('Unary plus expects numeric dtype, not {}'.format(values.dtype))
    return self.__array_wrap__(arr)

def __invert__(self):
    if not self.size:
        return self
    arr = operator.inv(com.values_from_object(self))
    return self.__array_wrap__(arr)

