@Appender(_shared_docs['replace'] % _shared_doc_kwargs)
def replace(self, to_replace=None, value=None, inplace=False, limit=None, regex=False, method='pad'):
    inplace = validate_bool_kwarg(inplace, 'inplace')
    if not is_bool(regex) and to_replace is not None:
        raise AssertionError("'to_replace' must be 'None' if 'regex' is not a bool")
    self._consolidate_inplace()
    if value is None:
        if not is_dict_like(to_replace) and (not is_dict_like(regex)):
            to_replace = [to_replace]
        if isinstance(to_replace, (tuple, list)):
            if isinstance(self, ABCDataFrame):
                return self.apply(_single_replace, args=(to_replace, method, inplace, limit))
            return _single_replace(self, to_replace, method, inplace, limit)
        if not is_dict_like(to_replace):
            if not is_dict_like(regex):
                raise TypeError('If "to_replace" and "value" are both None and "to_replace" is not a list, then regex must be a mapping')
            to_replace = regex
            regex = True
        items = list(to_replace.items())
        (keys, values) = zip(*items) if items else ([], [])
        are_mappings = [is_dict_like(v) for v in values]
        if any(are_mappings):
            if not all(are_mappings):
                raise TypeError('If a nested mapping is passed, all values of the top level mapping must be mappings')
            to_rep_dict = {}
            value_dict = {}
            for (k, v) in items:
                (keys, values) = list(zip(*v.items())) or ([], [])
                to_rep_dict[k] = list(keys)
                value_dict[k] = list(values)
            (to_replace, value) = (to_rep_dict, value_dict)
        else:
            (to_replace, value) = (keys, values)
        return self.replace(to_replace, value, inplace=inplace, limit=limit, regex=regex)
    else:
        if not self.size:
            return self
        new_data = self._data
        if is_dict_like(to_replace):
            if is_dict_like(value):
                res = self if inplace else self.copy()
                for (c, src) in to_replace.items():
                    if c in value and c in self:
                        res[c] = res[c].replace(to_replace=src, value=value[c], inplace=False, regex=regex)
                return None if inplace else res
            elif not is_list_like(value):
                keys = [(k, src) for (k, src) in to_replace.items() if k in self]
                keys_len = len(keys) - 1
                for (i, (k, src)) in enumerate(keys):
                    convert = i == keys_len
                    new_data = new_data.replace(to_replace=src, value=value, filter=[k], inplace=inplace, regex=regex, convert=convert)
            else:
                raise TypeError('value argument must be scalar, dict, or Series')
        elif is_list_like(to_replace):
            if is_list_like(value):
                if len(to_replace) != len(value):
                    raise ValueError('Replacement lists must match in length. Expecting %d got %d ' % (len(to_replace), len(value)))
                new_data = self._data.replace_list(src_list=to_replace, dest_list=value, inplace=inplace, regex=regex)
            else:
                new_data = self._data.replace(to_replace=to_replace, value=value, inplace=inplace, regex=regex)
        elif to_replace is None:
            if not (is_re_compilable(regex) or is_list_like(regex) or is_dict_like(regex)):
                raise TypeError("'regex' must be a string or a compiled regular expression or a list or dict of strings or regular expressions, you passed a {0!r}".format(type(regex).__name__))
            return self.replace(regex, value, inplace=inplace, limit=limit, regex=True)
        elif is_dict_like(value):
            new_data = self._data
            for (k, v) in value.items():
                if k in self:
                    new_data = new_data.replace(to_replace=to_replace, value=v, filter=[k], inplace=inplace, regex=regex)
        elif not is_list_like(value):
            new_data = self._data.replace(to_replace=to_replace, value=value, inplace=inplace, regex=regex)
        else:
            msg = 'Invalid "to_replace" type: {0!r}'.format(type(to_replace).__name__)
            raise TypeError(msg)
    if inplace:
        self._update_inplace(new_data)
    else:
        return self._constructor(new_data).__finalize__(self)

@Appender(_shared_docs['interpolate'] % _shared_doc_kwargs)
def interpolate(self, method='linear', axis=0, limit=None, inplace=False, limit_direction='forward', limit_area=None, downcast=None, **kwargs):
    """
    Interpolate values according to different methods.
    """
    inplace = validate_bool_kwarg(inplace, 'inplace')
    if axis == 0:
        ax = self._info_axis_name
        _maybe_transposed_self = self
    elif axis == 1:
        _maybe_transposed_self = self.T
        ax = 1
    else:
        _maybe_transposed_self = self
    ax = _maybe_transposed_self._get_axis_number(ax)
    if _maybe_transposed_self.ndim == 2:
        alt_ax = 1 - ax
    else:
        alt_ax = ax
    if isinstance(_maybe_transposed_self.index, MultiIndex) and method != 'linear':
        raise ValueError('Only `method=linear` interpolation is supported on MultiIndexes.')
    if _maybe_transposed_self._data.get_dtype_counts().get('object') == len(_maybe_transposed_self.T):
        raise TypeError('Cannot interpolate with all object-dtype columns in the DataFrame. Try setting at least one column to a numeric dtype.')
    if method == 'linear':
        index = np.arange(len(_maybe_transposed_self._get_axis(alt_ax)))
    else:
        index = _maybe_transposed_self._get_axis(alt_ax)
        methods = {'index', 'values', 'nearest', 'time'}
        is_numeric_or_datetime = is_numeric_dtype(index) or is_datetime64_any_dtype(index) or is_timedelta64_dtype(index)
        if method not in methods and (not is_numeric_or_datetime):
            raise ValueError('Index column must be numeric or datetime type when using {method} method other than linear. Try setting a numeric or datetime index column before interpolating.'.format(method=method))
    if isna(index).any():
        raise NotImplementedError('Interpolation with NaNs in the index has not been implemented. Try filling those NaNs before interpolating.')
    data = _maybe_transposed_self._data
    new_data = data.interpolate(method=method, axis=ax, index=index, values=_maybe_transposed_self, limit=limit, limit_direction=limit_direction, limit_area=limit_area, inplace=inplace, downcast=downcast, **kwargs)
    if inplace:
        if axis == 1:
            new_data = self._constructor(new_data).T._data
        self._update_inplace(new_data)
    else:
        res = self._constructor(new_data).__finalize__(self)
        if axis == 1:
            res = res.T
        return res

