def _clip_with_scalar(self, lower, upper, inplace=False):
    if (lower is not None and np.any(isna(lower))) or (
        upper is not None and np.any(isna(upper))
    ):
        raise ValueError("Cannot use an NA value as a clip threshold")

    result = self
    mask = isna(self.values)

    with np.errstate(all="ignore"):
        if upper is not None:
            subset = self.to_numpy() <= upper
            result = result.where(subset, upper, axis=None, inplace=False)
        if lower is not None:
            subset = self.to_numpy() >= lower
            result = result.where(subset, lower, axis=None, inplace=False)

    if np.any(mask):
        result[mask] = np.nan

    if inplace:
        self._update_inplace(result)
    else:
        return result

def _clip_with_one_bound(self, threshold, method, axis, inplace):

    if axis is not None:
        axis = self._get_axis_number(axis)

    # method is self.le for upper bound and self.ge for lower bound
    if is_scalar(threshold) and is_number(threshold):
        if method.__name__ == "le":
            return self._clip_with_scalar(None, threshold, inplace=inplace)
        return self._clip_with_scalar(threshold, None, inplace=inplace)

    subset = method(threshold, axis=axis) | isna(self)

    # GH #15390
    # In order for where method to work, the threshold must
    # be transformed to NDFrame from other array like structure.
    if (not isinstance(threshold, ABCSeries)) and is_list_like(threshold):
        if isinstance(self, ABCSeries):
            threshold = self._constructor(threshold, index=self.index)
        else:
            threshold = _align_method_FRAME(self, threshold, axis)
    return self.where(subset, threshold, axis=axis, inplace=inplace)

def _align_frame(
    self,
    other,
    join="outer",
    axis=None,
    level=None,
    copy=True,
    fill_value=None,
    method=None,
    limit=None,
    fill_axis=0,
):
    # defaults
    join_index, join_columns = None, None
    ilidx, iridx = None, None
    clidx, cridx = None, None

    is_series = isinstance(self, ABCSeries)

    if axis is None or axis == 0:
        if not self.index.equals(other.index):
            join_index, ilidx, iridx = self.index.join(
                other.index, how=join, level=level, return_indexers=True
            )

    if axis is None or axis == 1:
        if not is_series and not self.columns.equals(other.columns):
            join_columns, clidx, cridx = self.columns.join(
                other.columns, how=join, level=level, return_indexers=True
            )

    if is_series:
        reindexers = {0: [join_index, ilidx]}
    else:
        reindexers = {0: [join_index, ilidx], 1: [join_columns, clidx]}

    left = self._reindex_with_indexers(
        reindexers, copy=copy, fill_value=fill_value, allow_dups=True
    )
    # other must be always DataFrame
    right = other._reindex_with_indexers(
        {0: [join_index, iridx], 1: [join_columns, cridx]},
        copy=copy,
        fill_value=fill_value,
        allow_dups=True,
    )

    if method is not None:
        left = left.fillna(axis=fill_axis, method=method, limit=limit)
        right = right.fillna(axis=fill_axis, method=method, limit=limit)

    # if DatetimeIndex have different tz, convert to UTC
    if is_datetime64tz_dtype(left.index):
        if left.index.tz != right.index.tz:
            if join_index is not None:
                left.index = join_index
                right.index = join_index

    return left.__finalize__(self), right.__finalize__(other)

def _align_series(
    self,
    other,
    join="outer",
    axis=None,
    level=None,
    copy=True,
    fill_value=None,
    method=None,
    limit=None,
    fill_axis=0,
):

    is_series = isinstance(self, ABCSeries)

    # series/series compat, other must always be a Series
    if is_series:
        if axis:
            raise ValueError("cannot align series to a series other than axis 0")

        # equal
        if self.index.equals(other.index):
            join_index, lidx, ridx = None, None, None
        else:
            join_index, lidx, ridx = self.index.join(
                other.index, how=join, level=level, return_indexers=True
            )

        left = self._reindex_indexer(join_index, lidx, copy)
        right = other._reindex_indexer(join_index, ridx, copy)

    else:
        # one has > 1 ndim
        fdata = self._data
        if axis == 0:
            join_index = self.index
            lidx, ridx = None, None
            if not self.index.equals(other.index):
                join_index, lidx, ridx = self.index.join(
                    other.index, how=join, level=level, return_indexers=True
                )

            if lidx is not None:
                fdata = fdata.reindex_indexer(join_index, lidx, axis=1)

        elif axis == 1:
            join_index = self.columns
            lidx, ridx = None, None
            if not self.columns.equals(other.index):
                join_index, lidx, ridx = self.columns.join(
                    other.index, how=join, level=level, return_indexers=True
                )

            if lidx is not None:
                fdata = fdata.reindex_indexer(join_index, lidx, axis=0)
        else:
            raise ValueError("Must specify axis=0 or 1")

        if copy and fdata is self._data:
            fdata = fdata.copy()

        left = self._constructor(fdata)

        if ridx is None:
            right = other
        else:
            right = other.reindex(join_index, level=level)

    # fill
    fill_na = notna(fill_value) or (method is not None)
    if fill_na:
        left = left.fillna(fill_value, method=method, limit=limit, axis=fill_axis)
        right = right.fillna(fill_value, method=method, limit=limit)

    # if DatetimeIndex have different tz, convert to UTC
    if is_series or (not is_series and axis == 0):
        if is_datetime64tz_dtype(left.index):
            if left.index.tz != right.index.tz:
                if join_index is not None:
                    left.index = join_index
                    right.index = join_index

    return left.__finalize__(self), right.__finalize__(other)

def _where(
    self,
    cond,
    other=np.nan,
    inplace=False,
    axis=None,
    level=None,
    errors="raise",
    try_cast=False,
):
    """
    Equivalent to public method `where`, except that `other` is not
    applied as a function even if callable. Used in __setitem__.
    """
    inplace = validate_bool_kwarg(inplace, "inplace")

    # align the cond to same shape as myself
    cond = com.apply_if_callable(cond, self)
    if isinstance(cond, NDFrame):
        cond, _ = cond.align(self, join="right", broadcast_axis=1)
    else:
        if not hasattr(cond, "shape"):
            cond = np.asanyarray(cond)
        if cond.shape != self.shape:
            raise ValueError("Array conditional must be same shape as self")
        cond = self._constructor(cond, **self._construct_axes_dict())

    # make sure we are boolean
    fill_value = bool(inplace)
    cond = cond.fillna(fill_value)

    msg = "Boolean array expected for the condition, not {dtype}"

    if not isinstance(cond, ABCDataFrame):
        # This is a single-dimensional object.
        if not is_bool_dtype(cond):
            raise ValueError(msg.format(dtype=cond.dtype))
    elif not cond.empty:
        for dt in cond.dtypes:
            if not is_bool_dtype(dt):
                raise ValueError(msg.format(dtype=dt))

    cond = -cond if inplace else cond

    # try to align with other
    try_quick = True
    if hasattr(other, "align"):

        # align with me
        if other.ndim <= self.ndim:

            _, other = self.align(
                other, join="left", axis=axis, level=level, fill_value=np.nan
            )

            # if we are NOT aligned, raise as we cannot where index
            if axis is None and not all(
                other._get_axis(i).equals(ax) for i, ax in enumerate(self.axes)
            ):
                raise InvalidIndexError

        # slice me out of the other
        else:
            raise NotImplementedError(
                "cannot align with a higher dimensional NDFrame"
            )

    if isinstance(other, np.ndarray):

        if other.shape != self.shape:

            if self.ndim == 1:

                icond = cond.values

                # GH 2745 / GH 4192
                # treat like a scalar
                if len(other) == 1:
                    other = np.array(other[0])

                # GH 3235
                # match True cond to other
                elif len(cond[icond]) == len(other):

                    # try to not change dtype at first (if try_quick)
                    if try_quick:
                        new_other = com.values_from_object(self)
                        new_other = new_other.copy()
                        new_other[icond] = other
                        other = new_other

                else:
                    raise ValueError(
                        "Length of replacements must equal series length"
                    )

            else:
                raise ValueError(
                    "other must be the same shape as self when an ndarray"
                )

        # we are the same shape, so create an actual object for alignment
        else:
            other = self._constructor(other, **self._construct_axes_dict())

    if axis is None:
        axis = 0

    if self.ndim == getattr(other, "ndim", 0):
        align = True
    else:
        align = self._get_axis_number(axis) == 1

    block_axis = self._get_block_manager_axis(axis)

    if inplace:
        # we may have different type blocks come out of putmask, so
        # reconstruct the block manager

        self._check_inplace_setting(other)
        new_data = self._data.putmask(
            mask=cond,
            new=other,
            align=align,
            inplace=True,
            axis=block_axis,
            transpose=self._AXIS_REVERSED,
        )
        self._update_inplace(new_data)

    else:
        new_data = self._data.where(
            other=other,
            cond=cond,
            align=align,
            errors=errors,
            try_cast=try_cast,
            axis=block_axis,
        )

        return self._constructor(new_data).__finalize__(self)

@Appender(_shared_docs["shift"] % _shared_doc_kwargs)
def shift(self, periods=1, freq=None, axis=0, fill_value=None):
    if periods == 0:
        return self.copy()

    block_axis = self._get_block_manager_axis(axis)
    if freq is None:
        new_data = self._data.shift(
            periods=periods, axis=block_axis, fill_value=fill_value
        )
    else:
        return self.tshift(periods, freq)

    return self._constructor(new_data).__finalize__(self)

@Appender(_shared_docs["pct_change"] % _shared_doc_kwargs)
def pct_change(self, periods=1, fill_method="pad", limit=None, freq=None, **kwargs):
    # TODO: Not sure if above is correct - need someone to confirm.
    axis = self._get_axis_number(kwargs.pop("axis", self._stat_axis_name))
    if fill_method is None:
        data = self
    else:
        data = self.fillna(method=fill_method, limit=limit, axis=axis)

    rs = data.div(data.shift(periods=periods, freq=freq, axis=axis, **kwargs)) - 1
    rs = rs.reindex_like(data)
    if freq is None:
        mask = isna(com.values_from_object(data))
        np.putmask(rs.values, mask, np.nan)
    return rs

def _agg_by_level(self, name, axis=0, level=0, skipna=True, **kwargs):
    if axis is None:
        raise ValueError("Must specify 'axis' when aggregating by level.")
    grouped = self.groupby(level=level, axis=axis, sort=False)
    if hasattr(grouped, name) and skipna:
        return getattr(grouped, name)(**kwargs)
    axis = self._get_axis_number(axis)
    method = getattr(type(self), name)
    applyf = lambda x: method(x, axis=axis, skipna=skipna, **kwargs)
    return grouped.aggregate(applyf)

